import React, { useState, useEffect } from 'react';
import { Card, Button, Modal, Form, Alert } from 'react-bootstrap';
import axios from 'axios';

const DispensaryInfoCard = () => {
    const [dispensary, setDispensary] = useState({});
    const [showModal, setShowModal] = useState(false);
    const [formData, setFormData] = useState({
        dispensaryName: '',
        dispensaryType: '',
        licenseState: '',
        licenseNumber: '',
        businessAddress: {
            street: '',
            city: '',
            state: '',
            zip: '',
        },
    });
    const [alert, setAlert] = useState({ message: '', variant: '' });

    const states = [
        'AL', 'AK', 'AZ', 'AR', 'CA', 'CO', 'CT', 'DE', 'FL', 'GA', 'HI', 'ID', 'IL', 'IN', 'IA', 'KS', 'KY',
        'LA', 'ME', 'MD', 'MA', 'MI', 'MN', 'MS', 'MO', 'MT', 'NE', 'NV', 'NH', 'NJ', 'NM', 'NY', 'NC', 'ND',
        'OH', 'OK', 'OR', 'PA', 'RI', 'SC', 'SD', 'TN', 'TX', 'UT', 'VT', 'VA', 'WA', 'WV', 'WI', 'WY',
    ];
    const dispensaryTypes = ['delivery', 'pickup', 'both'];

    // Fetch dispensary details on component mount
    useEffect(() => {
        const fetchDispensaryData = async () => {
            try {
                const response = await axios.get('/api/vendors/profile', {
                    headers: {
                        Authorization: `Bearer ${localStorage.getItem('token')}`,
                    },
                });
                setDispensary(response.data.data);
            } catch (error) {
                console.error('Error fetching dispensary details:', error);
                setAlert({ message: 'Failed to load dispensary details.', variant: 'danger' });
            }
        };
        fetchDispensaryData();
    }, []);

    // Open modal and prefill form with current details
    const handleEdit = () => {
        setFormData({
            dispensaryName: dispensary.dispensaryName || '',
            dispensaryType: dispensary.dispensaryType || '',
            licenseState: dispensary.licenseState || '',
            licenseNumber: dispensary.licenseNumber || '',
            businessAddress: {
                street: dispensary.businessAddress?.street || '',
                city: dispensary.businessAddress?.city || '',
                state: dispensary.businessAddress?.state || '',
                zip: dispensary.businessAddress?.zip || '',
            },
        });
        setShowModal(true);
    };

    // Handle form input changes
    const handleChange = (e) => {
        const { name, value } = e.target;
        if (name.startsWith('businessAddress.')) {
            const addressField = name.split('.')[1];
            setFormData({
                ...formData,
                businessAddress: {
                    ...formData.businessAddress,
                    [addressField]: value,
                },
            });
        } else {
            setFormData({ ...formData, [name]: value });
        }
    };

    // Handle form submission
    const handleUpdate = async () => {
        try {
            const response = await axios.put('/api/vendors/profile', formData, {
                headers: {
                    Authorization: `Bearer ${localStorage.getItem('token')}`,
                },
            });
            setDispensary(response.data.data); // Update dispensary details in state
            setAlert({ message: 'Details updated successfully!', variant: 'success' });
            setShowModal(false); // Close modal
        } catch (error) {
            console.error('Error updating dispensary details:', error);
            setAlert({ message: 'Failed to update details.', variant: 'danger' });
        }
    };

    return (
        <div>
            {/* Display alert if available */}
            {alert.message && <Alert variant={alert.variant}>{alert.message}</Alert>}

            {/* Dispensary Details Card */}
            <Card className="shadow-sm mt-3" style={{ width: '28rem', margin: '0 auto' }}>
                <Card.Body className="d-flex justify-content-between align-items-center">
                    {/* Left Content */}
                    <div>
                        <Card.Title>{dispensary.dispensaryName || 'N/A'}</Card.Title>
                        <Card.Text>
                            {dispensary.dispensaryType || 'N/A'} <br />
                            <strong>License:</strong> {dispensary.licenseState || 'N/A'} {dispensary.licenseNumber || 'N/A'} <br />
                            <strong>Business Address:</strong> <br />
                            {dispensary.businessAddress?.street || 'N/A'}, {dispensary.businessAddress?.city || 'N/A'},{' '}
                            {dispensary.businessAddress?.state || 'N/A'} {dispensary.businessAddress?.zip || ''}
                        </Card.Text>
                    </div>

                    {/* Edit Button */}
                    <Button variant="btn-outline-secondary" size="sm" onClick={handleEdit}>
                        Edit
                    </Button>
                </Card.Body>
            </Card>

            {/* Edit Modal */}
            <Modal show={showModal} onHide={() => setShowModal(false)} centered>
                <Modal.Header closeButton>
                    <Modal.Title>Edit Dispensary Information</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <Form>
                        <Form.Group className="mb-3">
                            <Form.Label>Dispensary Name</Form.Label>
                            <Form.Control
                                type="text"
                                name="dispensaryName"
                                value={formData.dispensaryName}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>Dispensary Type</Form.Label>
                            <Form.Select
                                name="dispensaryType"
                                value={formData.dispensaryType}
                                onChange={handleChange}
                            >
                                <option value="">Select Type</option>
                                {dispensaryTypes.map((type) => (
                                    <option key={type} value={type}>
                                        {type}
                                    </option>
                                ))}
                            </Form.Select>
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>License State</Form.Label>
                            <Form.Select
                                name="licenseState"
                                value={formData.licenseState}
                                onChange={handleChange}
                            >
                                <option value="">Select State</option>
                                {states.map((state) => (
                                    <option key={state} value={state}>
                                        {state}
                                    </option>
                                ))}
                            </Form.Select>
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>License Number</Form.Label>
                            <Form.Control
                                type="text"
                                name="licenseNumber"
                                value={formData.licenseNumber}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>Business Address</Form.Label>
                            <Form.Control
                                type="text"
                                name="businessAddress.street"
                                placeholder="Street"
                                value={formData.businessAddress.street}
                                onChange={handleChange}
                            />
                            <Form.Control
                                type="text"
                                name="businessAddress.city"
                                placeholder="City"
                                className="mt-2"
                                value={formData.businessAddress.city}
                                onChange={handleChange}
                            />
                            <Form.Control
                                type="text"
                                name="businessAddress.state"
                                placeholder="State"
                                className="mt-2"
                                value={formData.businessAddress.state}
                                onChange={handleChange}
                            />
                            <Form.Control
                                type="text"
                                name="businessAddress.zip"
                                placeholder="Zip"
                                className="mt-2"
                                value={formData.businessAddress.zip}
                                onChange={handleChange}
                            />
                        </Form.Group>
                    </Form>
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={() => setShowModal(false)}>
                        Cancel
                    </Button>
                    <Button variant="primary" onClick={handleUpdate}>
                        Update
                    </Button>
                </Modal.Footer>
            </Modal>
        </div>
    );
};

export default DispensaryInfoCard;
